$.validator.methods.range=function(n,t,i){const r=n.replace(",",".");return this.optional(t)||r>=i[0]&&r<=i[1]};$.validator.methods.number=function(n,t){return this.optional(t)||/-?(?:\d+|\d{1,3}(?:[\s\.,]\d{3})+)(?:[\.,]\d+)?$/.test(n)};$.validator.methods.date=function(n,t){const i=n.split("/");return this.optional(t)||!/Invalid|NaN/.test(new Date(i[2],i[1],i[0]).toString())};